function bindWork(){var o=$(".area-dialog").dialog(),t="";$('a[data-type="work"]').click(function(a){a.preventDefault(),t=$(this).attr("href"),o.show()}),o.box.on("click",".area-box a",function(){var a=$(this).closest(".item").data("id");o.close(),postJson(t,{area_id:a},function(a){parseAjax(a)})})}